import React, {useState, useEffect} from 'react';
import './Home.css';

const Home = () => {
    return (
        <div>
            <h1>
                Play and Learn
            </h1>
            <h4>
                With the world's largest web developer site. 
            </h4>
            <a href="#signup" id="big-button">Get Started</a>
        </div>
    );
}

export default Home;

